        "title": "Roots | Foundations of Freeskiing (Full Movie) 4K",
        "description": "‚ñ∂Ô∏é For more on ‚ÄúRoots‚Äù with Factionüëá\nhttp://www.roots.movie\n\nThe Faction Collective‚Äôs third feature film uncovers the foundations of freeskiing as seen by the current generation of skiers. From the caves of the Dolomites to the nightscapes of Ruka and the mythic peaks surrounding Verbier, \"Roots\" takes us on a journey through the vibrant spectrum of freeskiing. In co-production with Red Bull Media House.\n\nIn Association with 1% for the Planet and Climate Partners, ‚ÄúRoots‚Äù is a Climate Neutral film. \n\nStarring:\nAlex Hall, Alexis Ghisleni, Antti Ollila, Astrid Cheylus, Bella Bacon, Ben Buratti, Blake Wilson, Cody Cirillo, Daniel Hanka, Duncan Adams, Elisabeth Gerritzen, Kadi Gomis, Mac Forehand, Margaux Hackett, Markus Fohr, Matƒõj ≈†vancer, Mathilde Gremaud, Micah Evangelista, Sam Anthamatten, Sandra Eie, Sarah Hoefflin, Simon Charri√®re, Sophia Rouches, Tim McChesney, Tim Sivignon & Yann Rausis\n\nDirected by: Etienne M√©rel\nProduced by: Tim Harty\nExecutive Producers: Alex Hoye & Florian Moser\nA Production by Bluemax Media\nPrincipal Cinematography: Etienne M√©rel, Julien Eustache, Jasper Newton & Tyler Hamlett\nAerial Cinematography: Stephane Guign√©, Nicolas Roubin, JC Lelard, Geoffrey Le Moal\n\nSupported by: GoPro, Julbo Eyewear & CAST Touring\n\nüéß Soundtracküëá\nhttps://spoti.fi/3oIAxfQ\n\nwww.factionskis.com\n\n¬© 2021 The Faction Collective SA \nPlease only use and share this embed code of the official video.\nThird party downloads and distribution is not permitted.\n\n___\nExperience the world of Red Bull Snow like you have never seen it before. With the best snow action sports clips on YouTube and original series,  from skiing to snowboarding, prepare for your \"stoke factor\" to be at an all time high.\n\nSubscribe to Red Bull Snow on Youtube: https://win.gs/SubToRedBullSnow\n\nGet the FREE Red Bull TV apps for all your devices:  https://go.onelink.me/351027264/35a30660\n\nRed Bull Snow on Facebook: